import logo from './logo.svg';
import './App.css';
import Homepage from './LandingComponant/Homepage';
import { Route, Routes } from 'react-router';
import LoginForm from './componant/LoginForm';
import AmbulanceRegisForm from './ambulance/AmbulanceRegisForm';
import PatientSignUp from './patient/PatientSignUp';
import Reactusereducer from './ambulance/AmbulanceRegisForm2';
import AmbulanceProfilePg from './ambulance/AmbulanceProfilePg';
import { BrowserRouter } from 'react-router-dom';
// import Landingpage from './LandingComponant/landingpage';

function App() {
  return (
    <div className="App">
      {/* <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header> */}

      <>

      <BrowserRouter>
        <Routes>
          <Route path='/' element={<Homepage/>} />
          <Route path='/login' element={ <LoginForm/> }/>
          {/* <Route path='/signup' element={ <SignUp/> } /> */}
          {/* <Route path='/ambulanceregisteration' element={ <AmbulanceRegisForm/> } /> */}
          <Route path='/ambulanceregisteration' element={ <Reactusereducer/> } />

          <Route path='/patientsignup' element={ <PatientSignUp/> } />

          {/* For Ambulance profile page */}
          <Route path='/ambulanceprofilepg' element={ <AmbulanceProfilePg/> } />

        </Routes>
        </BrowserRouter>
      </>



      {/* <Homepage /> */}

    </div>
  );
}

export default App;
